import React from "react";
import "../App.css";
const Navbar = () => {
  return (
    <div className="flex flex-coloumn align-center justify-between">
      <h1 className="text-red-600">NETFLIX</h1>
      <div className="flex  gap-5 text-white">
        <button className="p-[5px] bg-red-600 text-white">Sign In</button>
        <button className=""> Sign Up</button>
      </div>
    </div>
  );
};

export default Navbar;
